import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function Heading({ scrollToSpecials, scrollToAbout }) {
  const [navbarOpen, setNavbarOpen] = useState(false);
  function handleToggle() {
    setNavbarOpen(!navbarOpen);
  }

  return (
    <>
        <section className="in-session-box">
          <article className="in-session-text">
            <h1>IN SESSION</h1>
            <h2>Reserve a table</h2>
            <p> 
            </p>
            <Link to="/reserve" className="in-session-button" target="_blank" rel="noopener noreferrer">
              Reserve Now
            </Link>
          </article>
          <section className="in-session-image">
            <img
              src="../../../assets/art-cover.jpg"
              alt="Oasis Diner Interior"
            ></img>
          </section>

        </section>
    </>
  );
}
